  \"efoia-app\",\n\t\"isopen\": false,\n\t\"url\": null,\n\t\"notes\": \"By conveying
  the online request process to mobile devices, requesters can submit requests and
  check the status of existing requests anyplace, anytime. The mobile capabilities
  of the eFOIA app will greatly enhance the user experience, and provide convenience
  for the requester community. u2022Submit a FOIA request to any DHS Component. u2022Check
  the status of FOIA requests. u2022Access all of the content on the FOIA website,
  including the FOIA Library. u2022Receive updates, changes to events such as stakeholder
  meetings/conference calls held by the Department, and recently published documents.\",\n\t\"license_title\":
